import React, { Component } from 'react';
import './App.css';
import './data.js';
import FlightsTable from './components/FlightsTable';

const App = () => (
  <div className="app">
    <header className="header">
      <h1 className="title">Airline Routes</h1>
    </header>
    <section>
      <p>
        Welcome to the app!
    </p>
      <FlightsTable />
    </section>
  </div>
)

export default App;
